export const matchResults = {
    blackNumbers: [2, 4, 6, 8, 10, 11, 13, 15, 17, 20, 22, 24, 26, 28, 29, 31, 33, 35],
    redNumbers: [1, 3, 5, 7, 9, 12, 14, 16, 18, 19, 21, 23, 25, 27, 30, 32, 34, 36],
    applyFilters: function (results, label) {
        switch (label) {
            case "Even":
                var nresults = results.filter((result) => {
                    return (Number(result) % 2) === 0;
                })
                if (nresults.length === results.length) {
                    return true
                }
                else {
                    return false
                }
                break;
            case "Odd":
                var nresults = results.filter((result) => {
                    return (Number(result) % 2) !== 0;
                })
                if (nresults.length === results.length) {
                    return true
                }
                else {
                    return false
                }
                break;
            case "Red":
                var nresults = results.filter((result) => {
                    return this.redNumbers.includes(Number(result));
                })
                if (nresults.length === results.length) {
                    return true
                }
                else {
                    return false
                }
                break;
            case "Black":
                var nresults = results.filter((result) => {
                    return this.blackNumbers.includes(Number(result));
                })
                if (nresults.length === results.length) {
                    return true
                }
                else {
                    return false
                }
                break;
                default: 
                return "Error"
        }
    }
}
